  JWARREN, Peter Cory and FLETCHER, Margaret Mary
  WARREN, Fiona Mary and BAYENS, Philip
  02> WARREN, Fiona Marym on 03.02.1984 to BAYENS, Philip
  b 30.09.1961
  b 25.11.1958
  Fiona b. at Waipawa. Address: St Georges Road North, Hastings.
  Fiona was educated at Queenswood Rudolf Steiner School in Hastings and at Marsden College in
  Wellington then completed a secretarial course at Hawkes Bay Polytechnic. After a year with UEB,
  she joined Tremains in Napier as a travel consultant where she is now a relieving senior
  consultant,
  Philip parents were of Dutch and Hungarian origin and emigrated to New Zealand in the early 1950s.
  Philip trained as a diesel mechanic and worked at this job until the death of his father. He then
  took over the family orchard and cropping business and he and Fiona ran their own orchard until it
  was sold in 1997. Philip is now in the tractor business.
  Fiona's interests include gardening and handcrafts whilst Philip is involved with skiing. He has
  been President of the Hawkes Bay Ski Club for four years. He is also keen on motor racing and
  diving and has competed in jet boat marathons.
  01> BAYENS, Kate Fiona
  b 06.03.1990
  02> BAYENS, Hamish Philip
  b 03.03.1992 d 03.03.1992
  03> BAYENS, Heidi Rachael
  b 25.05.1993
  03> WARREN, Jonathan Peter
  b 24.03.1964
  Address: 66 Napier Terrace, Napier.
  Jonathan was educated at Hereworth School, Havelock North, and Nelson College then graduated Dip
  Physiotherapy from Otago Polytechnic in 1984. He worked at Burwood Spinal Unit then spent two
  years at the British Columbia Childrens's Hospital and a year in the United Kingdom. He is now in
  private practice in Napier. He is physiotherapist to the Hawkes Bay rugby team and to the Central
  Vikings.
  Jonathan is a keen skier, spending two years with the Whistler Ski Patrol in British Columbia and
  two seasons at Whakapapa on Mount Ruapehu. He also enjoys scuba diving and classical singing.
  03> WARREN, Peter Cory m on 22.04.1977 to (2)AITKEN, Penny
  b 22.06.1935
  b 08.02.1938
  Penny, d/o Sir Hallam and Lady Dowling, b. at Napier. Address: Te Pah, 493 Holden Road, Tikokino, RD
  4, Waipawa.
  Peter was educated at Huntley School, Marton, and Wanganui Collegiate School. On leaving school in
  1952, he worked at Tangihau Station, Gisborne, and for Jock Duncan at Elsthorpe before gaining a Dipag
  at Lincoln College in 1957.
  After his marriage to Mary, they settled at "Pukerangi" Station, at that time a bare block of 2,000
  acres. Peter was involved with Young Farmers and, later, with Federated Farmers and was Hawkes Bay
  Provincial Vice-President in 1971-73. After separating from Mary in 1973 he studied tropical
  agriculture in Queensland in preparation for an overseas project in Sarawak. However, for political
  reasons, it did not proceed. From 1974 he worked as an insurance broker for Sedgwick Group in Auckland
  until returning to "Pukerangi" in 1977. After selling in 1990, he purchased Te Pah at Tikokino where
  he now farms deer and bulls.
  Peter's interests include photography and flying. He is Vice-President and Chief Tow Pilot of the
  Waipukurau Gliding Club and has been a committee member of the Hawkes Bay Aero Club for ten years.
  (cont...)
